import React from 'react';
import '../../App.css';

const Database = () => {
  return (
    <div className="feature-container">
      <h1>Efficient Database</h1>
      <p>
        Our efficient database ensures all reports are securely stored and easily
        retrievable for future reference and analysis.
      </p>
    </div>
  );
};

export default Database;
